        super(props)

        this.state = {
            email:"",
            loginas:"",
            password:""
        }
    }
    Login = () =>{

    }
    render() {
        return (
            <Fragment>
                <div className="preloader">
        <div className="sk-double-bounce">
            <div className="sk-child sk-double-bounce1"></div>
            <div className="sk-child sk-double-bounce2"></div>
        </div>
    </div>

    {/* <!-- Header Layout   --> */}
    <div className="mdk-header-layout js-mdk-header-layout">

        {/* <!-- Header   --> */}

        <div id="header" className="mdk-header bg-dark js-mdk-header mb-0" data-effects="waterfall blend-background" data-fixed data-condenses>
            <div className="mdk-header__content">

                <div data-primary className="navbar navbar-expand-sm navbar-dark bg-dark p-0" id="default-navbar">
                    <div className="container">

                        {/* <!-- Navbar Brand   --> */}
                        <a href="/index" className="navbar-brand">
                            <img className="navbar-brand-icon" src="./assets/images/logo/white-100@2x.png" width="30" alt="E-learning"/>
                            <span className="d-none d-md-block">E-learning</span>
                        </a>

                        {/* <!-- Main Navigation   --> */}
                        <ul className="nav navbar-nav ml-auto d-none d-sm-flex">
                            <li className="nav-item">
                                <a href="/pricing" className="nav-link">Pricing</a>
                            </li>
                            <li className="nav-item">
                                <a href="/signup" className="nav-link">Signup</a>
                            </li>
                            <li className="nav-item active">
                                <a href="/login" className="nav-link">Login</a>
                            </li>
                        </ul>
                        {/* <!-- // END Main Navigation   --> */}

                        {/* <!-- Navbar toggler   --> */}
                        <button className="navbar-toggler navbar-toggler-right d-block d-md-none" type="button" data-toggle="sidebar">
                            <span className="navbar-toggler-icon"></span>
                        </button>

                    </div>
                </div>

            </div>
        </div>

        {/* <!-- // END Header   --> */}

        {/* <!-- Header Layout Content   --> */}
        <div className="mdk-header-layout__content page-content pb-0">

        </div>
        {/* <!-- // END Header Layout Content   --> */}

    </div>
    {/* <!-- // END Header Layout   --> */}

    <div className="navbar navbar-expand-sm navbar-mini navbar-dark fixed-bottom bg-dark d-none d-md-flex p-0" id="demo-navbar">

    </div>
     </Fragment>
        )
    }
}

export default Login
